import React from 'react';
import ReactDOM from 'react-dom';

const name = "Dark Batman";

ReactDOM.render(
    <>
        <h1>Hii Its {name}</h1>
        <img src="https://picsum.photos/200/300" />
    </>,
    document.getElementById('root')
);
